import { FC } from 'react';
import { CategoryMetadata, Metadata, RecipeMetadata } from '../types/recipe';
import { Box, Typography } from '@mui/material';
import { ROUTE_RECIPE } from '../routes';
import { Link } from 'react-router-dom';

const RecipeThumbnail: FC<{ metadata: RecipeMetadata | CategoryMetadata }> = ({
  metadata,
}) => {
  return (
    <Link to={ROUTE_RECIPE(metadata.type)}>
      <Box height={'480px'}>
        <img src={metadata.imgURL} alt="" className="object-cover h-[480px]" />
      </Box>
      <Typography textAlign={'center'}>{metadata.title}</Typography>
    </Link>
  );
};

